import { makeStyles } from '@mui/styles';
import React from 'react'

const useStyle = makeStyles((theme) => ({
    gardent01: {
        background: "linear-gradient(29deg, rgba(2,0,36,1) 24%, rgba(69,4,88,1) 71%, rgba(62,57,184,1) 100%)"
      },
    flexCenter: {
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      },
    flexCenterColumn: {
        display: "flex",
        justifyContent: "center",
        // alignItems: "center",
        flexDirection: "column",
      },
}));

const Contact = () => {
    const classes = useStyle();

    const contactSubmit = (e)=>{
        e.preventDefault();

    }
  return (
    <>
    <div className={`${classes.gardent01} ${classes.flexCenter}`} style={{width:'100vw', height:'100vh'}}>
        <form className={classes.flexCenterColumn}
         onSubmit={(e)=>contactSubmit(e)}
         style={{width:"50vmax", height:"50vmax"}}>
        <input type='text' value='' placeholder='name' 
        style={{padding:'0.3vmax', margin:'0.6vmax'}}/>
        <input type='email' value='' placeholder='email'  
        style={{padding:'0.3vmax',margin:'0.6vmax'}}/>
        <input type='number' value='' placeholder='phone'  
        style={{padding:'0.3vmax',margin:'0.6vmax'}}/>
        <textarea type='textarea' value='' placeholder='massage'  
        style={{padding:'0.3vmax',margin:'0.6vmax'}}/>
        <input type='submit' value='submit' placeholder='submit'  
        style={{padding:'0.3vmax',margin:'2vmax', width:'10vmax'}}/>

        </form>
    </div>
    </>
  )
}

export default Contact
